import React from 'react';
import Video from '../videos/video.mp4';
import {HeroContainer,HeroBg, VideoBg} from './HomeElements';


function Home() {
    return (
        <HeroContainer>
            <HeroBg>
                <VideoBg autoplay loopd muted src={Video} type="video/mp4"/>
            </HeroBg>
            <HeroContent>
                <HeroH1>Pick a photo</HeroH1>
            </HeroContent>

        </HeroContainer>
    )
}

export default Home;
